import { fontSize } from "@material-ui/system";
import pink from '@material-ui/core/colors/pink';

export default theme => ({
  root: {
    borderBottom: `1px solid ${theme.palette.border}`,
    backgroundColor: '#FEE9FF',
    display: 'flex',
    alignItems: 'center',
    height: '64px',
    zIndex: theme.zIndex.appBar
  },
  toolbar: {
    minHeight: 'auto',
    width: '100%'
  },
  src: {
    height: '100%',
    width: '100%'
  },
  title: {
    marginLeft: theme.spacing.unit,
    fontSize: '40px',
    position: 'relative',
    float: 'left',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, 0%)',
    color: '#fff',

  },
  menuButton: {
    marginLeft: '-4px'
  },
  notificationsButton: {
    marginLeft: 'auto'
  },
  signOutButton: {
    marginLeft: theme.spacing.unit
  },
  optionText: {
    marginTop: '2px',
    marginLeft: '5px',
  }
});
